// Staffs.js
import React from "react";
import { useLoaderData } from "react-router-dom";
import StaffsList from "../components/StaffsList";

function Staffs() {
  const staffs = useLoaderData();

  return <StaffsList staffs={staffs} />;
}

export default Staffs;
